            <div className='my-3'>
                <div className="card" style={{width: "18rem"}}>
                <img src={imageURL?imageURL:"/p"} className="card-img-top" alt="..." />
                <div className="card-body">
                <h5 className="card-title">{title}...</h5>
                <p className="card-text">{description}..</p>
                <a href={newsURL} target="_blank" className="btn btn-sm btn-primary">Learn More</a>
                </div>
                </div>
            </div>
        )
    }
}
